import React from "react";
import "./App.css";

function App() {
  const [searchResult, setSearchResult] = React.useState("");
  const [inputText, setInputText] = React.useState("");

  React.useEffect(() => {
    const url = `https://api-football-v1.p.rapidapi.com/v2/players/search/messi`;
    const accessToken = process.env.REACT_APP_REACT_FOOTBALL_API_KEY;

    fetch(url, {
      method: "GET",
      headers: {
        "x-rapidapi-host": "api-football-v1.p.rapidapi.com",
        "x-rapidapi-key": "3ab6deee7emsh797e9c862fb49b2p16f155jsn63530ff116f9",
      },
    })
      .then((response) => {
        console.log(response);
      })
      .catch((err) => {
        console.log(err);
      });
  });
  return (
    <div className="App">
      <h1>Hej!</h1>
    </div>
  );
}

export default App;
